import React from "react";

import classes from './CreateInterview';

const CreateInterview = () => {
    return (
        <div className={classes.container}>
            <form action="">
                <label htmlFor="">Date</label>
                <input type="date" />
            </form>
        </div>
    );
};

export default CreateInterview;
